(1,NULL,NULL,1,90,'SIMDIG',NULL,'Simulasi dan Komunikasi Digital','SIMDIG_1627819867','MENGENAL APLIKASI PADA MICROSOF',NULL,'<p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><span style=\"font-weight: bolder; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\">Pengertian Microsoft Office</span>&nbsp;dan Bagian-Bagian Microsoft Office Lengkap&nbsp; Microsoft Office merupakan salah satu perangkat lunak paket aplikasi perkantoran buatan dari Microsoft dan didesain untuk dijalankan di bawah sistem operasi Linux, Mac OS X dan Microsoft Windows. Beberapa aplikasi atau bagian di dalam&nbsp;<a href=\"http://www.dimensidata.com/brands/software/microsoft.aspx?orderby=15\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\">Microsoft Office</a>&nbsp;yang sudah populer adalah Ms Excel, Ms Word, dan Ms Powerpoint.</p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Aplikasi Ms Office terbaru yang diluncurkan adalah Office 15 atau Office 2013 yang diluncurkan pada Januari 2013 dan Microsoft Office 2016. Ms Office sebenarnya terdiri dari banyak sekali bagian. Berikut ini adalah penjelasan lengkap dari program  program Ms Office lengkap dengan fungsinya.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1. Microsoft Word</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8903 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Word.jpg\" alt=\"Pengertian dan Fungsi Microsoft Word\" width=\"600\" height=\"330\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Microsoft Word atau Ms Office Word merupakan perangkat lunak atau program pengolah kata andalah Microsoft. Program ini diterbitkan pertama kali pada tahun 1983 sebagai Multi Tool Word untuk Xenix. Selanjutnya beberapa versi lain juga dikembangkan untuk digunakan di sistem operasi lainnya. Setelah jadi bagian Ms Office System 2003 dan 2007, program ini dinamai dengan Ms Office Word. Sementara itu di Ms Office 2013, namanya menjadi Word.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2. Microsoft Excel</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8904 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Excel.jpg\" alt=\"Pengertian dan Fungsi Microsoft Excel\" width=\"600\" height=\"316\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini adalah program aplikasi lembar kerja yang dibuat oleh Microsoft Corporation untuk Ms Windows dan Mac OS. Program pengolah angka ini dilengkapi fitur kalkulasi dan pembuatan grafik sesuai dengan strategi marketing Microsoft. Hal ini membuat Ms Excel sebagai salah satu program komputer yang banyak digunakan untuk komputer mikro sampai saat ini. Saat ini, bahkan program ini menjadi program spreadsheet yang paling banyak dicari oleh banyak pihak.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3. Microsoft Power Point</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8906 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Power-Point.jpg\" alt=\"Pengertian dan Fungsi Microsoft Power Point\" width=\"600\" height=\"340\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Power Point adalah aplikasi presentasi yang dikembangkan oleh Microsoft dalam paket aplikasi kantoran mereka. Power Point berjalan di komputer PC berbasis Microsoft Windows dan Apple Macintosh. Walaupun aplikasi ini awalnya berjalan dengan sistem operasi Xenix, Power Point banyak digunakan di kalangan pebisnis dan kantoran, siswa, pendidik, dan trainer. Versi Power Point terbaru adalah versi 15 yakni Ms Office Power Point 2013.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">4. Microsoft Outlook</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8907 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Outlook.jpeg\" alt=\"Pengertian dan Fungasi Microsoft Outlook\" width=\"600\" height=\"339\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini adalah bagian dari suite Ms Office. Biasanya aplikasi ini digunakan untuk membaca dan mengirimkan surel. Ms Outlook juga dilengkapi dengan fungsi jadwal kerja, kalender, jurnal, dan catatan. Jika digunakan bersama Microsoft Exchange Server, aplikasi ini dapat memberikan akses kalender, surat, dan jadwal secara bersamaan.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">5. Microsoft Publisher</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8908 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Microsoft-Publisher.jpg\" alt=\"Microsoft Publisher\" width=\"600\" height=\"260\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini merupakan&nbsp;<a href=\"http://www.dimensidata.com/category/peralatan-kantor/?orderby=15\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\">paket aplikasi perkantoran</a>&nbsp;dari Microsoft yang berguna untuk membuat surat kabar, Desktop Publishing, kartu ucapan, dan masih banyak lagi. Awalnya Microsoft Publisher digunakan untuk Ms Office 2003 dan kemudian Ms Office 2007. Yang terbaru Publisher hadir di Ms Office 2010 pada edisi Profesional.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">6. Microsoft Access</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8909 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Access.jpg\" alt=\"Pengertian dan Fungsi Microsoft Access\" width=\"600\" height=\"337\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini adalah program aplikasi berbasis data komputer relasional untuk skala rumahan dan perusahaan mikro sampai menengah. Aplikasi ini adalah mesin basis data Ms Jet Database Engine dan menggunakan tampilan grafis intuitif sehingga dapat memberikan kemudahan bagi para penggunanya.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">7. Microsoft Info Path</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8910 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-InfoPath.jpg\" alt=\"Pengertian dan Fungsi Microsoft InfoPath\" width=\"600\" height=\"213\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Program aplikasi ini digunakan untuk membuat formulir pemasukan data dengan basis XML. Info Path pertama kali dirilis sebagai bagian Ms Office System 2003 dan saat ini merupakan bagian Ms Office System 2007. Saat dikembangkan, InfoPath mempunyai nama kode XDocs dan menyediakan fitur  fitur seperti membuat dan menampilkan dokumen XML yang didukung skema XML. Info Path juga dapat dikonfigurasi untuk memungkinkan terhubung dengan sistem eksternal menggunakan XML Web Services lewat MSXML dan SOAP Toolkit.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">8. Microsoft Lync</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8911 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Lync.jpg\" alt=\"Pengertian dan Fungsi Microsoft Lync\" width=\"600\" height=\"220\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini adalah aplikasi Microsoft yang sebelumnya dinamai dengan Office Communicator 2007 R2. Aplikasi ini dikeluarkan pada tahun 2011 dan saat ini sudah hadir dalam paket Ms Office 2013. Sebenarnya Lync mempunyai banyak fungsi. Tetapi bagi kebanyakan pengguna, Lync merupakan instant messenger seperti MSN Messenger dan Google Talk, Skype, dan Yahoo Messenger.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">9. Microsoft One Note</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8912 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-OneNote.jpg\" alt=\"Pengertian dan Fungsi Microsoft OneNote\" width=\"600\" height=\"286\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Aplikasi ini sesuai dengan namanya dapat digunakan sebagai kertas catatan di mana Anda dapat menggambar, menulis, mencorat coret, memasukkan objek, dan menampilkan screenshot.</p><h3 style=\"margin: 15px 0px; font-family: Montserrat, Geneva, &quot;Times New Roman&quot;, times; color: rgb(0, 0, 0); font-size: 20px; letter-spacing: normal; text-align: justify; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">10. Microsoft Visio</h3><p style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-8913 lazyloaded\" src=\"https://i0.wp.com/blog.dimensidata.com/wp-content/uploads/Pengertian-dan-Fungsi-Microsoft-Visio.jpg\" alt=\"Pengertian dan Fungsi Microsoft Visio\" width=\"600\" height=\"337\" style=\"vertical-align: baseline; border: 0px; text-align: justify; margin: 0px auto 15px; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; clear: both; max-width: 100%; height: auto; display: block;\"></p><p style=\"margin: 10px 0px; text-align: justify; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;Open Sans&quot;, sans-serif;\">Ini adalah program aplikasi yang biasa digunakan untuk membuat diagram, flowchart, skema jaringan, dan brainstorm. Aplikasi ini memanfaatkan grafik vektor untuk membuat diagram.</p>','2021-02-01 08:30:00',NULL,'Silahkan di baca dan di rangkum, agar nanti mudah dalam mengerjakan kuis',NULL,'oJUDoLQ1Dfo',1,'1','1.1',NULL,1,NULL,NULL,1,'2021-02-03 18:50:15',NULL,NULL,90,NULL,NULL),
(2,NULL,NULL,1,90,'SIMDIG',NULL,'Simulasi dan Komunikasi Digital','SIMDIG_1612751093','Pengertian Aplikasi Search Engine',NULL,'<p><img src=\"https://budutwj.id//storage/photos/YOUNGKI90/MATERI/602019d8c5849.png\" style=\"width: 100%;\"></p><p><br></p><p style=\"text-align: left;\"><span style=\"color: rgb(41, 43, 44); font-family: Lora, serif; font-size: 14px;\">Search engine (mesin pencari/pelacak/penelusur) adalah salah satu program komputer yang dirancang khusus untuk membantu seseorang menemukan file-file yang disimpan dalam komputer, misalnya dalam sebuah web server umum di web (www) atau komputer sendiri. Mesin pencari memungkinkan kita untuk meminta content media dengan kriteria yang spesifik (biasanya berisikan frase atau kata yang kita inginkan) dan memperoleh daftar file yang memenuhi kriteria tersebut.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Komponen Search Engine</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Search engine terdiri atas lima komponen, yaitu:</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">1. </span><b><span style=\"font-size: 14px;\">Query Interface</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Query interface adalah komponen penting pertama yang merupakan bentuk tampilan atau format situs yang menyediakan fasilitas searching engine. Bentuk yang paling sederhana adalah tersedianya sebuah kotak kosong di situs dimana user dapat menuliskan data atau informasi yang ingin dicari (lihat situs Yahoo.com atau Altavista.com). Yang harus diketahui oleh user adalah bahwa tidak semua situs memiliki kemampuan yang sama dalam membantu user untuk mengekspresikan jenis data atau informasi yang ingin dicari. Dalam bahasa komputer cara mengekspresikan ini disebut sebagai query. Contohnya adalah seseorang yang ingin mencari data atau informasi mengenai hal-hal yang berkaitan dengan kesehatan ibu dan anak, dapat menggunakan query semacam: kesehatan and ibu and anak.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">2. </span><b><span style=\"font-size: 14px;\">Query Engine</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Komponen kedua adalah Query Engine, merupakan sebuah program yang bertugas untuk menterjemahkan keinginan user ke dalam bahasa yang dimengerti oleh mesin komputer. Secara teknis, perusahaan-perusahaan penyedia searching engine berlomba-lomba membuat query engine yang baik sehingga selain tepat dalam mengekspresikan keinginan user, dapat pula melakukan tugas pencarian secara cepat.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">3. </span><b><span style=\"font-size: 14px;\">Database</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Database pada dasarnya merupakan kumpulan atau daftar dari dokumen maupun arsip dari seluruh situs yang ada di internet. Semakin besar skala internet, akan semakin besar pula kapasitas penyimpan yang dibutuhkan.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">4. </span><b><span style=\"font-size: 14px;\">Spider</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Spider merupakan komponen terpenting dalam sebuah searching engine. Secara berkala dan kontinyu, spider akan mendata setiap situs yang ada di internet, baik yang baru maupun yang lama. Terhadap masing-masing situs, selain alamatnya, akan diambil kata-kata kunci dari arsip maupun dokumen yang ditemukan. Katakanlah dari situs Bidanku.com akan diambil setiap kata pada kalimat judul artikel, disinilah sebenarnya persaingan antara situs terjadi, yaitu strategi dan teknik apa yang dipergunakan dalam melakukan sampling terhadap kata-kata yang akan menjadi kunci dalam pencarian arsip dan dokumen.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">5. </span><b><span style=\"font-size: 14px;\">Indexer</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Indexer merupakan sebuah program untuk mempercepat proses pencarian. Filosofi yang dipergunakan mirip dengan prinsip penggunaan indeks pada kamus atau buku-buku. Perang antar situs pun terjadi di sini, karena teknik melakukan indeks akan sangat berpengaruh terhadap kecepatan pencarian data atau informasi. Biasanya yang terjadi di sini adalah adu algoritma (alur logika sebuah program) antar para programmer yang direkrut oleh masing-masing perusahaan.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Jenis Search Engine</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Berdasarkan cara mengumpulkan data halaman-halaman web, mesin pencari dapat di kelompokkan menjadi 4 kategori :</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span style=\"font-size: 14px;\">Human Organized Search Engine</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Mesin pencari yang dikelola sepenuhnya oleh tangan manusia. Mesin pencari ini menggunakan metode dengan memilah-milih informasi yang relevan dan dikelompokan sedemikian rupa sehingga lebih bermakna dan bermanfaaat bagi penggunannya. Situs ini dalam prakteknya memperkerjakan para pakar dalam bidang-bidang tertentu, kemudian para pakar tersebut dapat mengkelompokan situs-situs tertentu sesuai dengan bidangnnya atau kategori situs itu sendiri.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span style=\"font-size: 14px;\">Computer Created Search Engine</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Search engine kategori ini banyak memiliki kelebihan karena banyak menyajikan inforrmasi walaupun kadang-kadang ada beberapa informasi yang tidak relevan tidak seperti yang kita inginkan. Search engine ini telah menggunakan software laba-laba atau spider software yang berfungsi menyusup pada situs-situs tertentu, kemudian mengumpulkan data serta mengelompokan dengan sedikit bantuan tangan manusia.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">&nbsp;3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span style=\"font-size: 14px;\">Hybrid Seacrh Engine</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Merupakan gabungan antara tangan manusia dengan computer, sehingga menghasilkan hasil pencarian yang relative akurat. Peran manusia dalam hal ini adalah sebagai penelaah dalam proses pengkoleksian database halaman web. Sebenarnya tipe ini lah yang paling mudah pembuatannya karena dapat didesain sesuai dengan keinginan kita.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><span style=\"font-size: 14px;\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span style=\"font-size: 14px;\">MetaCrawler/Metasearch</span></b></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Merupakan perantara dari mesin pencari yang sebenarnya. Mesin ini hanya akan mengirimkan permintaan pencarian ke berbagai mesin pencari serta menampilkan hasilnya satu di layer browser sehingga akan menampilkan banyak sekali hasil dari ber bagai mesin pencari yang ada.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Cara Kerja Search Engine</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Program Search Engine dalam menjalankan fungsinya sebenarnya bekerja bersamaan dengan Browser. Ketika kita mengetikkan sesuatu lalu Enter,&nbsp;&nbsp;Search Engine-lah yang bekerja melakukan pencarian di database. Hasil yang didapat diberikan kembali ke Browser, lalu Browser menampilkannya untuk kita dalam format yang mudah kita mengerti. Sebenarnya Search Engine tidak tampak, ia bekerja di balik layar. Search Engine juga sebenarnya bekerja dengan teman-temannya yaitu crawler atau indexer atau robot atau bot.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Sederhananya, proses yang berlangsung adalah: saat user membuka Browser, dan memerintahkan pencarian, maka browser minta tolong Search Engine untuk mencarikan. Jika sudah didapat, hasilnya dikembalikan ke Browser dan Browser menampilkannya untuk user. Semuanya berlangsung sangat cepat sehingga kita tidak mengetahui proses sesungguhnya yang terjadi.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Mesin pencari web bekerja dengan cara menyimpan informasi tentang banyak halaman web, yang diambil secara langsung dari www. Halaman ini di ambil dengan web crawler-browser web yang otomatis mengikuti setiap pranala yang dilihatnya. Isi setiap halaman lalu dianalisis untuk menentukan cara mengindeksnya (misalnya kata-kata di ambil dari judul, subjudul, atau field khusus yang di sebut meta tag). Data tentang halaman web disimpan dalam sebuah database indeks untuk digunakan dalam pencarian selanjutnya.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Sebagian mesin pencari seperti Google, menyimpan seluruh atau sebagian halaman sumber (yang disebut cache) maupun informasi tentang halaman web itu sendiri. Ketika seorang pengguna menggunakan mesin pencari dan memasukan query, biasanya dengan memasukan kata kunci, mesin mencari akan mengindeks dan memberikan daftar halaman web yang paling sesuai dengan kriterianya. Daftar ini biasanya disertai ringkasan singkat menggenai judul dokumen dan terkadang sebagian teks dari hasil pencarian yang kita cari.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Kelebihan:</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Kecepatan dan kemudahan dalam mencari</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;lebih canggih dengan fitur yang dimilikinya</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tampilan yang sederhana</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Google merupakan satu-satunya mesin pencari yang memilki cach. Dengan adanya cache ini, si pencari dapat menghemat waktu pencarian, karena hasil pencarian yang akan ditampilkan.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Kekurangan:</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Dengan kelebihan yang dimilikinya, ternyata mesin pencari ini jadi bidikan para spamer untuk menampilkan iklan-iklan yang tidak diperlukan. Mereka memanfaatkan setiap celah yang ada pada sistem algoritma Google untuk memaksa iklan mereka tampil pada halaman terdepan. Maka, pencarian pun terasa tergangggu.</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"box-sizing: inherit; font-weight: bolder; font-size: 14px;\">Boolean Logic</span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 24px;\"><b><span style=\"font-size: 14px;\">Boolean logic adalah</span></b><span style=\"font-size: 14px;\"> suatu pencarian pelacakan yang menyatakan tentang hubungan antara variabel yang dicari dengan variabel terkait. Boolean logic juga merupakan identifikasi spesifik tentang artikel yang akan dicari. Boolean logic dikembangkan oleh George Boole (1815-1864), adalah suatu metode pencarian informasi, yang memfokuskan hasil penelusuran dimana pencarian datanya menggunakan kata kunci.</span></span></p><p style=\"text-align: justify; box-sizing: inherit; margin-bottom: 1rem; font-size: 17px; line-height: 1.8; padding: 22px 16px 0px 0px; color: rgb(41, 43, 44); font-family: Lora, serif;\"><span style=\"font-size: 14px;\">Boolean logic terdiri dari operasi logika AND, OR dan NOT. Pada fitur pencarian Google, operasi ini merupakan bagian dari fitur pencarian dasar. Penggunaan operasi logika ini dapat memudahkan user dalam mendapatkan informasi yang diinginkan. Boolean logic merupakan operasi logika yang digunakan untuk mendapatkan informasi di PubMed (NCBI).</span></p><p><br></p>','2021-02-08 08:30:00',NULL,'Silahkan di bacak dan di amati\r\nKemudian silahkan dirangkung | pertemuan selanjutnya kita akan Kuis',NULL,NULL,3,'6','6',NULL,1,NULL,NULL,1,'2021-02-07 23:53:07',NULL,NULL,90,NULL,NULL),
