(5,1,NULL,1,90,'SIMDIG',NULL,'Simulasi dan Komunikasi Digital','SIMDIG_1628832639','UPT TIK Undiksha  merupakan salah satu unit yang mengemban tugas sebagai pelaksan',NULL,'<p>UPT TIK Undiksha&nbsp; merupakan salah satu unit yang mengemban tugas sebagai pelaksana teknis yang berhubungan langsung dengan sistem informasi berbasis Teknologi Informasi dan Komunikasi (TIK). UPT Teknologi Informasi dan Komunikasi merupakan unit pelaksana teknis di bidang pengembangan dan pengelolaan sistem dan teknologi informasi dan komunikasi yang berada di bawah dan bertanggung jawab kepada Rektor dan dikoordinasikan oleh Wakil Rektor Bidang Akademik. UPT Teknologi Informasi dan Komunikasi mempunyai tugas melaksanakan pengembangan, pengelolaan, dan pelayanan teknologi informasi dan komunikasi serta pengelolaan sistem informasi dan jaringan. Sebagai unit layanan teknis, UPT TIK tetap berusaha melakukan pengembangan-pengembangan sesuai dengan tuntutan, dan perkembangan teknologi. Pembentukan UPT TIK Undiksha telah melalui jalan yang cukup panjang dengan berbagai hambatan baik teknis maupun non teknis. Sebelum berubah nama menjadi UPT TIK, unit ini dikenal dengan nama Pusat Komputer (PUSKOM).</p><p><br></p><p>Dalam melaksanakan tugasnya, UPT Teknologi Informasi dan Komunikasi menyelenggarakan fungsi:</p><p><br></p><p>Penyusunan rencana, program, dan anggaran UPT;</p><p>Pengembangan teknologi informasi dan komunik</p><p>Pengelolaan teknologi informasi dan komunikasi;</p><p>Pemberian layanan di bidang teknologi informasi dan komunikasi;</p><p>Pengembangan dan pengelolaan sistem informasi;</p><p>Pengembangan dan pengelolaan jaringan;</p><p>Pemeliharaan dan perbaikan jaringan; dan</p><p>Pelaksanaan urusan tata usaha UPT.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'2021-08-13 12:30:39',NULL,NULL,90,NULL,NULL),
